CREATE TABLE Claims(
   ClaimID        VARCHAR(36) NOT NULL PRIMARY KEY
  ,PolicyHolderID VARCHAR(36) NOT NULL
  ,ClaimDate      DATE  NOT NULL
  ,ClaimAmount    NUMERIC(7,2) NOT NULL
  ,Fault          VARCHAR(3) NOT NULL
  ,AccidentTypeID INTEGER 
  ,VehicleTypeID  INTEGER  NOT NULL
  ,VehicleAge     INTEGER  NOT NULL
  ,ZipCode        INTEGER  NOT NULL
);
